declare const SQL_QUERY = "\nCREATE TABLE IF NOT EXISTS Phone (\n  \"number\" TEXT NOT NULL,\n  \"createdAt\" INTEGER NOT NULL DEFAULT CURRENT_TIMESTAMP,\n  \"updatedAt\" INTEGER NOT NULL DEFAULT CURRENT_TIMESTAMP,\n  \"deletedAt\" INTEGER,\n  \"system\" TEXT CHECK(`system` in ('CELL', 'LAND', 'FAX', 'VOIP', 'TOLLFREE', 'OTHER', NULL)),\n  \"sms\" INTEGER,\n  \"voice\" INTEGER,\n  \"ndnc\" INTEGER,\n  CONSTRAINT PhonePk PRIMARY KEY (\"number\")\n) WITHOUT ROWID;\n\n";
export default SQL_QUERY;
